import React from 'react';

export default class Residence extends React.Component {
  render() {

    return (
      <div>
        <label> Casa </label>
          <input 
            name="residence" 
            type="radio" 
            value="casa" 
            checked={true}>

          </input>

          <label> Apartamento </label>
          <input 
            name="residence" 
            type="radio" 
            value="apartamento">

          </input> 

      </div>
    )
  }
}
